import React from "react";
import "./Slide.css"

const Slide = ({ idx, title, url ,cN}) => {
  return (
    <div className={cN}>

      <div className="slide_title">{title}</div>
      <iframe src="" frameborder="0">
      <div className="slide_image">
        <img src={url} alt={title} />
      </div>
      </iframe>
    </div>
  );
};

export default Slide;
